}
if (msg.payload === 'Fahrenheit') {
    flow.set("tempUnit", 'f')
    return { payload: 0, label: 'Celsus', tempUnit: flow.get("tempUnit") };
}

const ky = (flow.get("distance_unit") === 'km') ? 40075 / 360 : 25019 / 360;
function arePointsNear(checkPoint, centerPoint) {
 const kx = Math.cos(Math.PI * centerPoint.lat / 180.0) * ky;
 const dx = Math.abs(centerPoint.lng - checkPoint.lng) * kx;
 const dy = Math.abs(centerPoint.lat - checkPoint.lat) * ky;
 return Math.sqrt(dx * dx + dy * dy);
}
const lastrike = flow.get("lastrike")||0;
if (lastrike === 0) {
    flow.set("lastrike", Date.now() - 86400000 * 180); // default is 180 days - stored in volatile memory
}
const strike = { lat: msg.payload.lat, lng: msg.payload.lon };

// set latitute + longitude accordingly
const home = { lat: flow.get("lat_home"), lng: flow.get("long_home") };
let n = arePointsNear(strike, home);
n = Math.round(n);

// set strike radius in 'Km' accordingly for '<= 25)' & 'n >25' -- 25Km is default
const dunit = flow.get("distance_unit");
if(n <= flow.get("strike_distance")) {
    flow.set("lastrike", Date.now()); // update lastrike with new strike time
